import React, { Component } from "react";
import styled, { css } from "styled-components";
import { FontAwesome, Entypo } from "@expo/vector-icons";

function OnlineOrderHome(props) {
  return (
    <Container>
      <LogoGroup>
        <Logo src={require("../assets/images/dpos-logo-white.png")}></Logo>
        <Dash src={require("../assets/images/image_ridw..png")}></Dash>
      </LogoGroup>
      <BtnContainerRow>
        <PickupBtn>
          <ButtonOverlay>
            <PickupBtnTxt>PICK UP</PickupBtnTxt>
          </ButtonOverlay>
        </PickupBtn>
        <DeliveryBtn>
          <ButtonOverlay>
            <DeliveryBtnTxt>DELIVERY</DeliveryBtnTxt>
          </ButtonOverlay>
        </DeliveryBtn>
      </BtnContainerRow>
      <BottomRowGroup>
        <DetailsLocationGroup>
          <PhoneNumberRow>
            <FontAwesome
              name="phone"
              style={{
                color: "rgba(255,255,255,1)",
                fontSize: 50,
              }}
            ></FontAwesome>
            <PhoneNumberTxt>(226) 600-5925</PhoneNumberTxt>
          </PhoneNumberRow>
          <AddressRow>
            <Entypo
              name="location-pin"
              style={{
                color: "rgba(255,255,255,1)",
                fontSize: 50,
              }}
            ></Entypo>
            <AddressTxt>32 Sunrise Drive,{"\n"}Kitchener, Ontario</AddressTxt>
          </AddressRow>
        </DetailsLocationGroup>
        <SocialIconsGroup>
          <FacebookIcon
            src={require("../assets/images/image_pDaA..png")}
          ></FacebookIcon>
          <InstagramIcon
            src={require("../assets/images/image_CLpi..png")}
          ></InstagramIcon>
        </SocialIconsGroup>
      </BottomRowGroup>
    </Container>
  );
}

const Container = styled.div`
  display: flex;
  background-color: rgba(30, 30, 30, 1);
  flex-direction: column;
  align-items: center;
  justify-content: space-between;
  height: 100vh;
  width: 100vw;
`;

const ButtonOverlay = styled.button`
  display: block;
  background: none;
  height: 100%;
  width: 100%;
  border: none;
`;
const LogoGroup = styled.div`
  flex-direction: column;
  height: 80px;
  padding: 10px;
  justify-content: space-between;
  align-self: flex-start;
  display: flex;
`;

const Logo = styled.img`
  width: 237px;
  height: 100%;
  object-fit: contain;
`;

const Dash = styled.img`
  height: 100%;
  width: 0px;
  object-fit: contain;
`;

const BtnContainerRow = styled.div`
  flex-direction: row;
  width: 683px;
  justify-content: space-between;
  display: flex;
`;

const PickupBtn = styled.div`
  width: 219px;
  height: 60px;
  background-color: rgba(238, 125, 67, 1);
  border-radius: 60px;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  border: none;
  box-shadow: 3px 3px 10px 0.2px rgba(0, 0, 0, 1);
`;

const PickupBtnTxt = styled.span`
  font-family: Roboto;
  font-style: normal;
  font-weight: 700;
  color: rgba(255, 255, 255, 1);
  font-size: 18px;
`;

const DeliveryBtn = styled.div`
  width: 219px;
  height: 60px;
  background-color: rgba(238, 125, 67, 1);
  border-radius: 60px;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  border: none;
  box-shadow: 3px 3px 10px 0.2px rgba(0, 0, 0, 1);
`;

const DeliveryBtnTxt = styled.span`
  font-family: Roboto;
  font-style: normal;
  font-weight: 700;
  color: rgba(255, 255, 255, 1);
  font-size: 18px;
`;

const BottomRowGroup = styled.div`
  flex-direction: row;
  justify-content: space-between;
  align-items: flex-end;
  align-self: stretch;
  display: flex;
`;

const DetailsLocationGroup = styled.div`
  flex-direction: column;
  justify-content: center;
  margin: 10px;
  display: flex;
`;

const PhoneNumberRow = styled.div`
  width: 231px;
  height: 65px;
  flex-direction: row;
  justify-content: space-between;
  align-items: center;
  display: flex;
`;

const PhoneNumberTxt = styled.span`
  font-family: Roboto;
  font-style: normal;
  font-weight: 500;
  color: rgba(255, 255, 255, 1);
  font-size: 25px;
`;

const AddressRow = styled.div`
  width: 231px;
  height: 65px;
  flex-direction: row;
  justify-content: space-between;
  align-items: center;
  display: flex;
`;

const AddressTxt = styled.span`
  font-family: Roboto;
  font-style: normal;
  font-weight: 400;
  color: rgba(255, 255, 255, 1);
  font-size: 23px;
`;

const SocialIconsGroup = styled.div`
  width: 190px;
  flex-direction: row;
  justify-content: space-between;
  align-items: center;
  margin: 10px;
  display: flex;
`;

const FacebookIcon = styled.img`
  height: 57px;
  width: 100%;
  object-fit: contain;
`;

const InstagramIcon = styled.img`
  height: 57px;
  width: 100%;
  object-fit: contain;
`;

export default OnlineOrderHome;
